class ElementType:
    '''
    Represents page element type.
    '''
    
    # Text element.
    Text = "text"

    # Image element.
    Image = "image"

    # Code 128 barcode element.
    Code128Barcode = "code128Barcode"

    # Code 39 barcode element.
    Code39Barcode = "code39Barcode"

    # Code 2 of 5 barcode element.
    Code25Barcode = "code25Barcode"

    # Code 93 barcode element.
    Code93Barcode = "code93Barcode"

    # Code 11 barcode element.
    Code11Barcode = "code11Barcode"

    # GS1 data bar barcode element.
    GS1DataBarBarcode = "gs1DataBarBarcode"

    # IATA 25 barcode element.
    IATA25Barcode = "iata25Barcode"

    # MSI barcode element.
    MSIBarcode = "msiBarcode"

    # Stacked GS1 data bar barcode element.
    StackedGS1DataBarBarcode = "stackedGs1DataBarBarcode"

    # Aztec barcode element.
    AztecBarcode = "aztecBarcode"

    # Data Matrix barcode element.
    DataMatrixBarcode = "dataMatrixBarcode"

    # Macro PDF417 barcode element.
    MacroPDF417Barcode = "macroPdf417Barcode"

    # PDF417 barcode element.
    PDF417Barcode = "pdf417Barcode"

    # QR Code barcode element.
    QRCode = "qrCode"

    # Page numbering element.
    PageNumbering = "pageNumbering"

    # Line element.
    Line = "line"

    # Rectangle element.
    Rectangle = "rectangle"